import React from "react";
import { Link } from "react-router-dom";
import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import cookies from "js-cookie";
import "./Login.css";

const Login = () => {
  const [loginValues, setLoginValues] = useState({
    email: "", // Changed to email
    password: "",
    showSubmitError: false,
    errorMsg: "",
  });
  const navigate = useNavigate();

  const onSubmitSuccess = (jwt_token) => {
    cookies.set("jwt_token", jwt_token, { expires: 30 });
    navigate("/Home");
  };

  const onSubmitFailure = (errorMsg) => {
    setLoginValues((prevState) => ({
      ...prevState,
      showSubmitError: true,
      errorMsg,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const { email, password } = loginValues; // Changed from username to email
    const userDetails = { email, password }; // Sending email instead of username

    const url = "https://nodebackend-books.onrender.com/user/login";
    const options = {
      method: "POST",
      headers: {
        "Content-Type": "application/json", // Set the correct content type
      },
      body: JSON.stringify(userDetails),
    };

    const response = await fetch(url, options);
    const data = await response.json();

    if (response.ok) {
      onSubmitSuccess(data.token); // Changed from jwt_token to token to match backend
    } else {
      onSubmitFailure(data.error); // Changed from error_msg to error
    }
  };

  const onChangeEmail = (e) => {
    setLoginValues({ ...loginValues, email: e.target.value }); // Changed from username to email
  };

  const onChangePassword = (e) => {
    setLoginValues({ ...loginValues, password: e.target.value });
  };

  useEffect(() => {
    const jwtToken = cookies.get("jwt_token");
    if (jwtToken) {
      navigate("/Home");
    }
  }, [navigate]);

  const { showSubmitError, errorMsg } = loginValues;

  return (
    <div className="background-main">
      <div className="mainn-container">
        <div className="second-main">
          <div className="imagediv">
            <img className="image" src="/images/Bookslogo1.jpeg" alt="login" />
          </div>
          <div className="secondHalf">
            <div className="corner-btn">
              <Link to="/Login">
                <button className="btn-login" type="submit">
                  Login
                </button>
              </Link>
              <Link to="/register">
                <button className="btn-register" type="submit">
                  Register
                </button>
              </Link>
            </div>
            <div className="loginformdiv">
              <form onSubmit={handleSubmit} className="formitems">
                <h1 className="main-heading">Login</h1>
                <label className="h6 input-label">Email</label>
                <input
                  onChange={onChangeEmail}
                  className="input"
                  type="email" // Changed to email input type
                  placeholder="Enter your email"
                  value={loginValues.email}
                  required
                />
                <label className="h6 input-label">Password</label>
                <input
                  onChange={onChangePassword}
                  className="input"
                  type="password"
                  placeholder="Enter your password"
                  value={loginValues.password}
                  required
                />
                <button className="submit-btn" type="submit">
                  Sign In
                </button>
                {showSubmitError && <p className="error_message">*{errorMsg}</p>}
                <div className="ancor">
                  <a className="anchor-link" href="#0">
                    Forgot password?
                  </a>
                  <a className="anchor-link" href="#0">
                    Not a Member Yet?
                  </a>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
